import React from "react";

import ExpenseItem from "./ExpenseItem";
import "./ExpensesList.css";

const ExpensesList = (props) => {
  if (props.asdf.length === 0) {
    return <h2 className="expenses-list_fallback">Found no oexpenses.</h2>;
  }

  return (
    <ul classNam="expenses-list">
      {props.asdf.map((expense) => (
        <ExpenseItem
          key={expense.id}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      ))}
    </ul>
  );
};

export default ExpensesList;
